<!DOCTYPE html>
<!-- This page is demonstration of Gesture 3D to rotate a 3D DNA Model -->
<html lang="en">
<head>
	<meta charset="utf-8">
	<title>DNA</title>
		
  <link rel='stylesheet' type='text/css' href='../common/css/x3dom.css'></link>
  <!-- Initialize the 3D DOM library -->
	<script src='../common/js/x3dom.js'></script>
  <!-- Initialize supporting libraries -->
	<script src="../common/js/compatibility.js"></script>
	<script src="../common/js/smoother.js"></script>
	<!-- Initialize the fist detection libraries-->
	<script src="../common/js/humandetect.js"></script>
	<script src="../common/js/humandetect.handfist.js"></script>
	
	<script>
	window.onload = function() {
	  compatibility.getUserMedia 
		var smoother = new Smoother([0.9995, 0.9995], [0, 0], 0),
			canvas = document.getElementById('canvas'), // retrieve the canvas 
			context = canvas.getContext('2d'), // retrieve the 2D context of canvas (neded for drawing the video overlay)
			video = document.createElement('video'), //create the element for video overlay 
			detector; //create the element for detection 
    
    /**
     * Checks for WebRTC compatibility of the browser. 
     * AirTouch needs WebRTC for accessing video camera. 
    */
		try {
			compatibility.getUserMedia({video: true}, function(stream) {
				try {
					video.src = compatibility.URL.createObjectURL(stream);
				} catch (error) {
					video.src = stream;
				}
				compatibility.requestAnimationFrame(play);
			}, function (error) {
				alert("Error code 0xc7145: The system is not compatible. I am working on it to bring this to all available systems.");
			});
		} catch (error) {
			alert(error);
		}

    var fist_pos_old, angle = [0, 0]; // Declaration of variables that reduce false positives
    
		/**
     * Executes the detection after the camera starts getting a video feed.
     * Inputs: void
     * Outputs: void  
     */
		function play() {
			compatibility.requestAnimationFrame(play);
			if (video.paused) video.play();
	        
	    // Draw video overlay:
			context.save();
			context.scale(-1, 1);
			var newwidth = ~~(200 * video.videoWidth / video.videoHeight);
			context.translate(-newwidth , 0);
			var newheight = 200;
			context.drawImage(video, newwidth, 0, -newwidth, newheight);
			context.restore();
			if (video.readyState === video.HAVE_ENOUGH_DATA && video.videoWidth > 0) {
			
				// Prepare the detector once the video dimensions are known:
	          	if (!detector) {
		      		var width = ~~(140 * video.videoWidth / video.videoHeight);
					    var height = 140;
		      		detector = new humandetect.detector(width, height, 1.1, humandetect.handfist);
		      	}
          		
        // Smooth rotation of the 3D object:
				angle = smoother.smooth(angle);
				document.getElementById('transform_a').setAttribute('rotation', '0 1 0 ' + angle[0]); 
				document.getElementById('transform_b').setAttribute('rotation', '1 0 0 ' + angle[1]);
		

			  // Perform the actual detection - see more in humandetect.js:
				var coords = detector.detect(video, 1);
				
				if (coords[0]) {
					var coord = coords[0];
					
					// Rescale coordinates from detector to video coordinate space:
					coord[0] *= -video.videoWidth / detector.canvas.width;
					coord[1] *= video.videoHeight / detector.canvas.height;
					coord[2] *= -video.videoWidth / detector.canvas.width;
					coord[3] *= video.videoHeight / detector.canvas.height;
          
          // Form a bounding box from co-ordinates:
					var fist_pos = [coord[0] + coord[2] / 2, coord[1] + coord[3] / 2];
          
          /**
           * Checks if the fist's position jumps out of bounds. 
           * If it does do not rotate the model
           * Else rotate the model proportionately
           */ 
					if (fist_pos_old) {

						var dx = (fist_pos[0] - fist_pos_old[0]) / video.videoWidth,
							dy = (fist_pos[1] - fist_pos_old[1]) / video.videoHeight,
              jump_x = fist_pos[0] - fist_pos_old[0],
                  jump_y = fist_pos[1] - fist_pos_old[1];
            
          if (Math.abs(jump_x)< 20 && Math.abs(jump_y)< 50){
	
                  if (dx*dx + dy*dy < 0.2) {
                    angle[0] += 5.0 * dx;
                    angle[1] += 5.0 * dy;
                          }
              }
                  fist_pos_old = fist_pos;
          } else  {
            fist_pos_old = fist_pos; 	
						
					} 
				
					// Draw coordinates on video overlay:
					context.beginPath();
					context.lineWidth = '2';
					context.fillStyle = fist_pos_old ? 'rgba(0, 0, 255, 0.5)' : 'rgba(255, 0, 0, 0.5)'; //To see co-ordinates change alpha to > 0.25
					context.fillRect(
						coord[0] / video.videoWidth * newwidth,
						coord[1] / video.videoHeight * canvas.clientHeight,
						coord[2] / video.videoWidth * newwidth,
						coord[3] / video.videoHeight * canvas.clientHeight);
					context.stroke();
				} else fist_pos_old = null;
				
			}
		}
	};
    </script>
</head>
